window.bookSummaryJSON = "Noted naturopathic physician Dr. Peter J. D'Adamo introduces a revolutionary new way to eat and live. <p>In <i>Eat Right for Your Type</i>, he explains his groundbreaking diet plan by blood type. Our blood type is a road map to our inner chemistry - and each blood type processes food, handles stress, and fights disease differently. Find out what you should be eating and how you should exercise in accord with your own type.</p>"; 
